// src/App.js

import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';

// --- Components and Context ---
import { AuthProvider, useAuth } from './context/AuthContext';
import ProtectedRoute from './components/ProtectedRoute'; 
import Layout from './components/Layout'; // <-- NEW: Import the Layout wrapper
import Header from './components/Header'; // <-- USED inside Layout, but good practice to know it's there

// --- Pages (Public) ---
import Login from './pages/Login';
import Register from './pages/Register'; // <-- NEW: Import the registration page

// --- Placeholder Components ---
const AdminDashboard = () => <Layout><h1>Admin Dashboard - Full Access</h1></Layout>;
const DoctorDashboard = () => <Layout><h1>Doctor Dashboard - Your Patients & Schedule</h1></Layout>;
const PatientDashboard = () => <Layout><h1>Patient Dashboard - My Appointments & Records</h1></Layout>;
const ForgotPassword = () => <Layout><h1>Forgot Password (Under Construction)</h1></Layout>; // <-- NEW: Placeholder page

// ----------------------------------------------------------------------
// Main Application Component
// ----------------------------------------------------------------------

const App = () => {
    // We wrap the entire router (AppRoutes) in AuthProvider to ensure
    // authentication state is available everywhere.
    return (
        <AuthProvider>
            <AppRoutes />
        </AuthProvider>
    );
};

// ----------------------------------------------------------------------
// Routing Logic
// ----------------------------------------------------------------------

const AppRoutes = () => {
    const { isLoggedIn, role } = useAuth();

    // Determines the appropriate redirect path after login
    const getDashboardPath = (userRole) => {
        if (userRole === "ROLE_ADMIN") return "/admin/dashboard";
        if (userRole === "ROLE_DOCTOR") return "/doctor/dashboard";
        if (userRole === "ROLE_PATIENT") return "/patient/dashboard";
        return "/";
    };

    return (
        <Routes>
            {/* 1. Public Routes (Do NOT use Layout here, as Login/Register pages manage their own styling/centering) */}

            {/* Base Route: Redirects to dashboard if logged in, otherwise shows Login */}
            <Route path="/" element={isLoggedIn ? <Navigate to={getDashboardPath(role)} /> : <Login />} />

            {/* NEW: Registration and Forgot Password Routes */}
            <Route path="/register" element={<Register />} />
            <Route path="/forgot-password" element={<ForgotPassword />} />

            {/* 2. Protected Routes (Use Layout wrapper inside ProtectedRoute) */}

            {/* Admin */}
            <Route path="/admin/dashboard" element={<ProtectedRoute requiredRole="ROLE_ADMIN"><AdminDashboard /></ProtectedRoute>} />

            {/* Doctor */}
            <Route path="/doctor/dashboard" element={<ProtectedRoute requiredRole="ROLE_DOCTOR"><DoctorDashboard /></ProtectedRoute>} />

            {/* Patient */}
            <Route path="/patient/dashboard" element={<ProtectedRoute requiredRole="ROLE_PATIENT"><PatientDashboard /></ProtectedRoute>} />

            {/* General Dashboard Catch-all (for redirects from ProtectedRoute) */}
            <Route path="/dashboard" element={isLoggedIn ? <Navigate to={getDashboardPath(role)} /> : <Navigate to="/" />} />

            {/* Catch-all: Redirects any unknown route back to the base path */}
            <Route path="*" element={<Navigate to="/" />} />
        </Routes>
    );
};

export default App;
